import { ArrowUpIcon } from "@phosphor-icons/react";

const Middle = () => {
    return (
      <div style={{padding:"1%", borderRadius:"12px", boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)', backgroundColor:"#FAFAFA ", height:"96vh", width:"100%", textAlign: 'center', backdropFilter: 'blur(8px)',margin:"1vh"}}>
        Insurio
        <div style={{ display:"flex", justifyContent:"spacebetween", paddingLeft: '12px',paddingRight:"12px",paddingTop:"15pxS", backgroundColor:"#F0F0F0",borderRadius:"12px", position:"fixed", bottom:"6%", left: "50%",transform: 'translateX(-50%)', width:"40%",height:"10%"}}>

            <div style={{ display: 'flex', marginBottom: '0px' }}>
            <input
                type="text"
                placeholder="Ask about any coverage"
                style={{
                    flex: 1,
                    borderRadius: '8px',
                    backgroundColor: '#f0f0f0',
                    marginRight: '10px',
                    border: 'none',
                    fontSize: '16px',
                    color: '#A0A0A0',
                    transition: 'background 0.3s'

                    }}
            />
            <div style={{
                    width:"32px",
                    height:"32px",
                    borderRadius: '100px',
                    background:"#000000",
                    color: '#A0A0A0',
                    border: 'none',
                    cursor: 'pointer',
                    display:'flex',
                    alignItems:'center',
                    justifyContent:'center'
                }}>
            <ArrowUpIcon size={24}  color="#FFF" weight="bold" />

                </div>


        </div>

  {/* Clickable Options */}
  <div style={{ display: 'flex', gap: '8px', paddingLeft:"12px"}}>
    {['Search', 'Compare', 'Cost Estimate'].map((label) => (
      <div
        key={label}
        onClick={() => alert(`${label} clicked`)}
        style={{
          textAlign: 'center',
          paddingLeft: "16px",
          paddingRight:"16px",
          paddingTop:"10px",
          paddingBottom:"10px",
          color: '#A0A0A0',
          borderRadius: '10px',
          backgroundColor: '#FAFAFA',
          borderStyle: "1px",
          display:'flex',
          alignItems:'center',
          cursor: 'pointer',
          transition: 'background 0.3s',
        }}
      >
        {label}
      </div>
    ))}
  </div>
</div>

      </div>
    );
  };

  export default Middle;
